import React from "react";
import "./Nav.css";

const Nav = () => {
    return (
        <div className="nav">
            <img
                src="https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg"
                alt="Netflix Logo"
                className="nav__logo"
            />

            <img
                src="https://upload.wikimedia.org/wikipedia/commons/0/0b/Netflix-avatar.png"
                alt="User Avatar"
                className="nav__avatar"
            />
        </div>
    );
};

export default Nav;
